(300, 1, '2019-08-28 12:49:26', '2019-08-28 12:49:26', '<!-- wp:paragraph -->\n<p> Built by MoveUp this staggering project included the construction of seven new mid-rise buildings on the 35-acre West Don Lands site. Following the Games, the area will be transformed into the mixed-use Canary District Community, a vibrant new neighbourhood that will boast market condos and townhomes, affordable rental housing, retail space, the Cooper Koo Family YMCA, and George Brown College\'s first student residence. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":60,\"align\":\"center\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"your_website_url_here/wp-content/uploads/2019/02/services-img-1-1024x720.jpg\" alt=\"\" class=\"wp-image-60\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p> One of the various trades skills challenges featured at the Expo, the scaffolding competition tested student teams from Kwantlen Polytechnic University as they laid out and erected scaffolding, using materials donated by Scaffold Depot, over a span of five hours. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Winners will be announced tomorrow, and judges will assess the students’ performances with high regard given to the aspects of safety, stability and workmanship. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>“We’re pleased CLAC asked us to partake in the GameChanger scaffolding competition and assist in guiding the student teams,” said Ryan Hodgson, General Manager of Construction Operations at MoveUp. “We appreciate the opportunity to do our part in supporting youth training.” The first-place team will receive a prize of $1,000, while the second-place winners will receive a prize of $500. A contribution of $2,000 will also be made to Kwantlen Polytechnic University.<br></p>\n<!-- /wp:paragraph -->', 'Has consul eirmod veritus laudem tacimates minim debitis', '', 'publish', 'open', 'open', '', 'has-consul-eirmod-veritus-laudem-tacimates-minim-debitis-2', '', '', '2019-08-28 14:51:34', '2019-08-28 14:51:34', '', 0, 'your_website_url_here/?p=300', 0, 'post', '', 0),
